import React, { ReactNode } from "react";
import { RouteProps } from "react-router-dom";
import {
  BuildOutlined,
  ChromeOutlined,
  ExperimentOutlined,
  IdcardOutlined,
  ProfileOutlined,
  UserOutlined,
} from "@ant-design/icons";
import AboutMeScreen from "../pages/about-me/lazy";
import ResidencesScreen from "../pages/residences/lazy";

export type RouteItem = Omit<RouteProps, "path"> & {
  name: string;
  title: string;
  icon?: ReactNode;
  hideInMenu?: boolean;
  children?: RouteItem[];
  path?: string;
};

export const routes: RouteItem[] = [
  {
    name: "residences",
    title: "Danh sách",
    icon: <IdcardOutlined />,
    component: ResidencesScreen,
    path: "/residences",
    exact: true,
  },
  {
    name: "about-me",
    title: "About me",
    icon: <UserOutlined />,
    component: AboutMeScreen,
    path: "/about-me",
    exact: true,
  },
